import React from 'react';

class CourseworkPanel extends React.Component {
  constructor(props) {
    super(props)
  }

  render() {
    return (
      <ul>
        { this.props.coursework.map((value, index) => (<li key={index} className="coursework">{value}</li>)) }
      </ul>
    )
  }
}

export default CourseworkPanel
